import { deleteServerData } from '../helper/helper';

export const useDeleteResult = () => {
    const deleteResult = async (resultId) => {
        try {
            if(!resultId) {
                console.error('Result ID not provided');
                return;
            }
            const url = `http://localhost:5000/api/result/${resultId}`;
            await deleteServerData(url, (data) => console.log('Result deleted successfully:', data));
        } catch (error) {
            console.error('Error deleting result:', error);
        }
    };

    return deleteResult;
};
